import React from 'react';

import Title from "../Title/Title";

import './style.scss'

import add from '../../assets/images/icons/add.svg';

const Header = (props) => {
	return (
		<div className="header">
			<Title
				title={props.title}
				subtitle={props.subtitle}
			/>
			<div className="btn">
				<img src={add} alt="Create a product"/>
				Create a product
			</div>
		</div>
	);
};

export default Header;
